.inputContainer {
  display: flex;
  flex-direction: row;
  align-items: center;
  margin-bottom: 15px;
  color: var(--white-color);
}

.inputField {
  /* color: var(--white-color); */
  border: none;
  border-radius: 5px;
  background-color: var(--textfield-background-color);
  font-size: 16px;
  padding: 15px;
  outline: none;
  flex-grow: 1;
}

.inputField.withLabel {
  margin-left: 10px;
  min-width: 25%;
}

.inputLabel {
  width: 100%;
}
